  ival text;
BEGIN
  SELECT faker.time_unit() INTO ival;
  ival = (RANDOM() * 100)::text || ' ' || ival;
  RETURN ival::interval;
END;
$EOFCODE$ LANGUAGE plpgsql VOLATILE;

CREATE FUNCTION faker.interval ( min int, max int ) RETURNS interval AS $EOFCODE$
